  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:02.549482\",\n\t\"name\": \"inventory-and-monitoring-of-streaked-horned-larks-on-agricultural-lands-willamette-valley-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In an effort to refine knowledge of nest
  success of streaked horned larks in the southern Willamette Valley, field personnel
  found and monitored nests at William L. Finley National Wildlife Refuge and Corvallis
  Municipal Airport throughout breeding season 2012. MDAC Farms was excluded from
  the study because of the low numbers of breeding STHL encountered in 2012. General
  linear modeling in Program MARK showed that the 2012 estimate of nest success was
  very poor in relation to previous breeding seasons. Similar to previous seasons,
  there was no relationship between success rate and covariates measured at the nest
  site, but nest success increased dramatically as the breeding season progressed.
  In an effort to begin gathering data on survival rates of STHL in the post-fledging
  period, a subset of fledglings were tracked using standard radio telemetry techniques
  and analyzed with the same methods used for modeling nest success.\",\n\t\"license_title\":
